import { getUser } from "../Util";
//TABMESSAGEING MODAL
export function TabMessagingModal(data) {
  const toolData = {
    _id: data._id || null,
    name: getUser(),
    toolId: data.toolId,
    status: true,
    title: data.name,
    toolName: data.toolName,
    toolData: {
      isImage: data.isImage,
      emoji: data.emoji,
      FAVICON: data.FAVICON,
      messages: data.messages,
      timeFirstMsg: data.timeFirstMsg,
      timeBetweenTwoMsg: data.timeBetweenTwoMsg,
      SOUND: data.SOUND,
    },
    CODE: data.CODE,
  };
  return toolData;
}
// _id: id, toolName: ToolUtil.getTool(data.toolId), toolId: data.toolId, name: data.data
export function TabMessagingModalResponse(res) {
  const data = res.data.data;
  if (!data) return null;
  return {
    _id: data._id,
    toolId: data.toolId,
    status: data.status,
    name: data.title,
    toolName: data.toolName,
    isImage: data.toolData.isImage,
    emoji: data.toolData.emoji,
    FAVICON: data.toolData.FAVICON,
    messages: data.toolData.messages,
    timeFirstMsg: data.toolData.timeFirstMsg,
    timeBetweenTwoMsg: data.toolData.timeBetweenTwoMsg,
    SOUND: data.toolData.SOUND,
    CODE: data.CODE,
  };
}
//END TABMESSAGEING
//Urgency timer
export function UrgencyTimerModal(data) {
  const toolData = {
    _id: data._id || null,
    name: getUser(),
    toolId: data.toolId,
    status: true,
    title: data.name,
    toolName: data.toolName,
    TEXT: data.TEXT,
    CODE: data.CODE,
    STYLE: data.STYLE,
    TIMER: data.TIMER,
    toolData: data.toolData,
  };
  return toolData;
}

export function UrgencyTimerModalResponse(res) {
  const data = res.data.data;
  if (!data) return null;
  return {
    _id: data._id,
    toolId: data.toolId,
    status: data.status,
    name: data.title,
    toolName: data.toolName,
    TEXT: data.TEXT,
    CODE: data.CODE,
    STYLE: data.STYLE,
    TIMER: data.TIMER,
    toolData: data.toolData,
  };
}
//END URGENCY
//HELLO BAR
export function HELLOBARModal(data) {
  const toolData = {
    _id: data._id || null,
    name: getUser(),
    toolId: data.toolId,
    status: true,
    title: data.name,
    toolName: data.toolName,
